import React from "react";
import eduUs from "../asset/img/Group 82.svg";
import logo from "../asset/img/Group 256.svg"
import { Form, FormControl, FloatingLabel, Button} from "react-bootstrap";

function LoginPage(){
    return(
        <div id={'background'}>
            <div id={'container'}>
                <div id={'left-container'}>
                    <a href="/"><i className={'fa-solid fa-house'} id={'home-btn'}></i></a>
                    <div id='introContent'>
                        <img src={logo} alt={'logo'}></img>
                        <img src={eduUs} alt={'logo'}></img>
                        <h1>Welcome Back</h1>
                        <h2>Please login to continue</h2>
                    </div>
                </div>
                <div id='right-container'>
                    <p>Login</p>
                    {/* <Form action="">
                        <div id="groupName" class="inputGroup">
                            <FormLabel for="name">Name:</FormLabel>
                            <FormText type="text" id="name" class="inputText" name="name"></FormText>
                        </div>
                        <div id="groupPass" class="inputGroup">
                            <label for="pass">Password:</label>
                            <input type="password" id="pass" class="inputText" name="password"></input>
                        </div>
                        <div id="moreDetails">
                            <div id="groupRemember">
                                <input type="checkbox" id="remember" name="remember"></input>
                                <label for="remember">Remember</label>
                            </div>
                            <a href="/">Forgot password?</a>
                        </div>
                        <Button variant="contained">Continue</Button>
                    </Form> */}
                    {/* Floating Label = Bootstrap */}
                    {/* <div class="form-floating mb-3">
                            <input type="email" class="form-control" id="floatingInput" placeholder="name@example.com"></input>
                            <label for="floatingInput">Email address</label>
                        </div> */}
                        {/* <FloatingLabel 
                            controlId="floatingInput"
                            label="Email address"
                            className="mb-3">
                                <Form.Control type="email" placeholder="name@example.com" />
                        </FloatingLabel> */}
                    <Form className={"login-form"}>
                        {/* Username */}
                        <FloatingLabel 
                            controlId={"userGroup"}
                            className={"mb-3"}
                            label={"Username"}>
                            <FormControl
                                type={"text"}
                                name={"username"}
                                controlId={"username"}
                                placeholder={"Enter username"}
                                required
                            />
                        </FloatingLabel>
                        {/* Password */}
                        <FloatingLabel 
                            controlId={"passGroup"}
                            className={"mb-3"}
                            label={"Password"}>
                            <FormControl
                                type={"password"}
                                name={"password"}
                                controlId={"password"}
                                placeholder={"Enter password"}
                                required
                            />
                        </FloatingLabel>
                        <Form.Check inline className={"mb-5"} 
                            id={"remember"} 
                            name={"remember"} 
                            label={"Remember"} 
                            type={"checkbox"}/>
                        <a href="/">Forgot password?</a>
                        <Button type="submit">Continue</Button>
                        {/* Continue</Button> */}
                    </Form>
                </div>
            </div>
        </div>  
    );
}
export default LoginPage;
